    return(
        <div>
        <Box
        sx={{
          display: "flex",
          flexDirection: 'row',
          justifyContent: "space-evenly"
        }}>
          <BodyLeft />
          <BodyRight />
        </Box>
        <Footer />
        </div>
    )
}
export default Home;
